import Player from "./Player";
import classes from "./Activity.module.css";
import { Loader } from "rsuite";

export default function ActivityData({ players, data }) {
  if (data[players[0].name] === undefined) {
    return <Loader />;
  }
  return (
    <div className={classes.playersActivity}>
      <table className={classes.generalTable}>
        <thead>
          <tr>
            <td>Player</td>
            <td>[L]</td>
            <td>[G]</td>
            <td>[PM]</td>
            <td>[Warns]</td>
            <td>[Mutes]</td>
            <td>[Kicks]</td>
            <td>[Bans]</td>
            <td>[AVG]</td>
            <td>[Total]</td>
            <td>[Vanish]</td>
            <td>[Status]</td>
          </tr>
        </thead>
        <tbody>
          {players.map((player) => {
            return (
              <tr key={player.name}>
                <td>
                  <Player player={player} />
                </td>
                <td>{data[player.name]["L"]}</td>
                <td>{data[player.name]["G"]}</td>
                <td>{data[player.name]["PM"]}</td>
                <td>{data[player.name]["Warns"]}</td>
                <td>{data[player.name]["Mutes"]}</td>
                <td>{data[player.name]["Kicks"]}</td>
                <td>{data[player.name]["Bans"]}</td>
                <td>{data[player.name]["AVG"].replace("|", "</br>")}</td>
                <td>{data[player.name]["Total"]}</td>
                {data[player.name]["Vanish"] ? <td>on</td> : <td>off</td>}
                {data[player.name]["Status"] ? (
                  <td>online</td>
                ) : (
                  <td>offline</td>
                )}
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
